    "description": "\nCisco A9K-MOD400-TR ASR 9000 MOD400 Modular Line Card, Packet Transport Optimized Part Number: A9K-MOD400-TR The new Cisco® ASR 9000 Series 400G and 200G Modular Line Cards provide customers with a highly flexible solution. They support multiple combinations of Ethernet ports, all in a single slot of the Cisco ASR 9000 Series Aggregation Services Routers (ASR 9000 Series). These modular line cards have two open bays (bay 0 and bay 1) for plugging in ASR 9000 Series Modular Port Adapters (MPA), which gives network operators the flexibility to choose the ideal port density, speed, and optic based on their network requirements. With ASR 9000 Series modular line cards and the MPA portfolio, Cisco continues to focus on investment protection, along with consistent feature support, broad interface availability, and the latest technology. The latest additions to the MPA portfolio include the Cisco ASR 9000 Series 20-Port 10GE Modular Port Adapter, the 2-Port 100GE Modular Port Adapter, the 1-port 100G and 200G Modular Port Adapter and the MACSec enabled 32 port 1GE Modular Port Adapter. The minimum software release versions for these new MPAs are shown in Table 5 and Table 6. Supported pluggable interfaces are shown in Table 4. Using modular line cards along with port adapters, the ASR 9000 Series can support a wide range of customer applications, including video on demand, Internet Protocol Television (IPTV), point-to-point video, Internet video, and cloud-based computing. The line cards can also be used to deliver economical, scalable, highly available, line‑rate Ethernet, and IP/Multiprotocol Label Switching (IP/MPLS) edge services. Cisco ASR 9000 Series line cards and routers are designed to provide the fundamental infrastructure for scalable Carrier Ethernet and IP/MPLS networks, supporting profitable business, residential, and mobile services. SR 9000 Series line cards are fully compatible with the Cisco ASR 9922 Router, ASR 9912 Router, ASR 9910 Router, ASR 9906, ASR 9904 Router, ASR 9010 Router, and ASR 9006 Router, as well as ASR 9000 Series Route Switch Processors (RSPs), route processors, and other Typhoon Network Processing Unit (NPU)-based line cards. Total bandwidth is dependent on the number and type of RSPs installed. The new 400G and 200G modular line cards deliver the ability to mix and match modular port adapters so that customers can customize each slot in the ASR 9000 to their specific port demands. For example, in the case of the 400G modular line cards, a 20-port 10 Gigabit Ethernet modular port adapter can be matched with a 2-port 100 Gigabit Ethernet modular port adapter, all in a single slot, for a total bandwidth of 400 gigabits per slot. In the case of a 200G modular line card, two 1-port 100 or 200 Gigabit Ethernet modular port adapters can be used per slot for a total of 200 or 400 gigabits per slot, or a single 2-port 100 Gigabit Ethernet or a single 20-port 10 Gigabit Ethernet modular port adapter can be used to get 200 gigabits per slot. Both the 200G and 400G modular cards are compatible with all earlier generations of port adapters. The new 32 port 1 Gigabit Ethernet modular port adapter in addition to all features, supports the hop by hop as well as WAN MACSec encryption. MACSec is the next-generation encryption technology in federal, enterprise, cloud and service provider transport networks. WAN MACSec provides capability to deploy seamlessly over any public carrier Ethernet, optical, DWDM/OTN transport network. The Cisco ASR 9000 Series 400G and 200G Modular Line Cards provide simultaneous support for both Layer 2 and Layer 3 services and features. This capability helps operators qualify and stock a single line card that can be deployed in any combination of Layer 2 and Layer 3 applications. It also helps reduce Capital Expenditures (CapEx) and Operating Expenses (OpEx), as well as reduce the time required to develop and deploy new services. Cisco modular line cards set exceptional standards for service density, allowing operators to offer predictable, managed transport services while optimizing the use of network assets. \n"
