  "473": {
    "image": "https://www.networkoutlet.com/cdn/shop/products/WS-X45-SUP9-E_300x300.jpg?v=1625770508",
    "title": "WS-X45-SUP9-E Catalyst 4500E Supervisor Engine 9-E",
    "brand": "Cisco",
    "category": "Networking Engines",
    "price": "$2,900.00",
    "description": "\nThe Cisco Catalyst® 4500E Supervisor Engine 9-E (Figure 1) is the next generation of enterprise-class switching engine. The Cisco Unified Access™ Data Plane (UADP) Application-Specific Integrated Circuit (ASIC) powers fabric-enabled wireless and helps enable uniform wired and wireless policy enforcement, application visibility, flexibility, and application optimization.The Cisco Catalyst 4500E Supervisor Engine 9-E is an enterprise-class access and aggregation supervisor engine designed to provide up to 928 Gbps of wired access per system with an E-Series chassis. It also supports up to 20 Gbps of wireless termination. The Supervisor Engine 9-E provides 48 Gbps per slot with Flexible NetFlow (FNF), integrated Wireshark, and advanced security, combined with reduced Total Cost of Ownership (TCO) and excellent investment protection. These capabilities, along with four 10 Gigabit Ethernet and two 40 Gigabit Ethernet uplink ports and 384 10/100/1000 access ports with Power over Ethernet (PoE), PoE Plus (PoE+), and Cisco Universal PoE (Cisco UPOE®), make this supervisor engine the leading Cisco access supervisor engine in the Cisco Catalyst Family. Supervisor Engine 9-E facilitates user experiences for enterprise, public sector, midmarket, and commercial customer business-critical applications.Backward and forward compatibility with most existing Cisco Catalyst 4500 and 4500E Series line cards and power supplies helps assure greater customer satisfaction with an industry-leading investment protection architecture. The Supervisor Engine 9-E is supported in Cisco Catalyst 4500E Series chassis.\nThe Cisco Catalyst 4500E Supervisor Engine 9-E offers the following:● Performance and capabilities\n\nUp to 928 Gbps wired switching capacity with 250 Mpps of throughput\nUp to 20 Gbps of wireless termination capacity. Support for up to 100 access points and 2000 wireless clients on each switching entity\nUp to two 40 Gigabit Ethernet uplinks (Quad Small Form-Factor Pluggable Plus [QSFP+])\nUp to 4 nonblocking 10 Gigabit Ethernet uplinks (Small Form-Factor Pluggable Plus [SFP+])\nSFP support on uplinks to offer flexibility for up to 4 Gigabit Ethernet ports\n384 ports of nonblocking 10/100/1000\nPoE+ (30W) capabilities on all ports in a line card simultaneously\nCisco UPOE (60W) capabilities on all line card slots\nEnergy Efficient Ethernet (IEEE 802.3az)\n388 ports of non blocking Gigabit Ethernet SFP (4 uplink ports plus 384 line card ports)\n100 ports of 10 Gigabit Ethernet SFP+ (4 uplink ports plus 96 line card ports)\nUp to 128,000 FNF entries in hardware\nSD card support for flexible storage options\n256,000 routing entries for high-end campus access and aggregation deployments\nIPv6 support in hardware, providing wire-rate forwarding for IPv6 networks\nDual stack support for IPv4/IPv6 and dynamic hardware forwarding-table allocations for ease of IPv4-to-IPv6 migration\nScalable routing (IPv4, IPv6, and multicast) tables and Layer 2 tables\nScalable and dynamic allocation of Access Control List (ACL) and Quality of Service (QoS) entries to use 8 queues per port and comprehensive security policies per port\nSD-Access: The Supervisor Engine 9-E forms the foundational building block for SD-Access – Cisco’s leading enterprise architecture, which includes:\n\nPolicy-based automation from edge to cloud\nSegmentation and micro-segmentation made easy, with predictable performance and scalability\nAutomation through the Cisco Application Policy Infrastructure Controller – Enterprise Module (APIC-EM)\nPolicy through the Cisco Identity Services Engine (ISE)\n\n\nPart Number: WS-X45-SUP9-E\n\n"
  },
