    "brand": "Cisco",
    "category": "Routers",
    "price": "$75.00",
    "description": "\nThe Cisco 1841 Modular Router w/ 2FE 32F 128D is part of the Cisco family which provides the broadest line of solutions for transporting data, voice and video while ensuring that networks both public and private operate with maximum performance, security, and flexibility. This particular router features fast data transfers, integrated security layers, a variety of connection types and the ability to install additional hardware components. The security layers included are hardware compression, built-in firewall, IDS (Intrusion Detection System), IPS (Intrusion Prevention System), VPN, VLAN and Dynamic MultiPoint VPN network support. The CISCO1841 has 128 MB SDRAM pre-installed with the ability to install up to 384 MB SDRAM and 32 MB of Flash Memory embedded with the possibility of installing up to 128 MB. Device Type: Router Form Factor: Desktop - modular - 1U Dimensions (WxDxH): 13.5 in x 10.8 in x 1.7 in Features: Firewall protection, hardware compression, VPN support, VLAN support, Intrusion Detection System (IDS), Intrusion Prevention System (IPS), wall mountable, Dynamic Multipoint VPN (DMVPN), Network Admissions Control (NAC) Data Link Protocol: Ethernet, Fast Ethernet Compliant Standards: CSA, CTR 21, CISPR 22 Class A, CISPR 24, EN 60950, EN 61000-3-2, IEC 61000-4-11, IEC 61000-4-2, IEC 61000-4-3, IEC 61000-4-4, IEC 61000-4-5, IEC 61000-4-6, EN 61000-3-3, EN55024, EN55022 Class A, EN50082-1, EN 61000-4-4, EN 61000-4-2, EN 61000-4-3, EN 61000-4-6, CS-03, EN 61000-4-5, UL 60950-1 Interfaces: 2 x 10Base-T/100Base-TX - RJ-45 ¦ USB : 1 x 4 pin USB Type A ¦ Management : 1 x console ¦ Management : 1 x auxiliary Expansion Slots: 1 (total) / 0 (free) x CompactFlash ¦ Memory ¦ 1 (total) / 1 (free) x AIM ¦ 2 (total) / 2 (free) x HWIC \n"
