    "description": "\nThe Cisco ASR1001 Router is a single-rack-unit (RU) router that supports 2.5 to 5 GBps forwarding capacity through simple throughput upgrade licenses. This flexibility allows for network operators to increase their network capacity and servicews without a hardware upgrade. The ASR1001 also features four built-in GB Ethernet ports, redundant dual power supplies, and one shared port adapter (SPA) slot that supports single-height SPAs. The Cisco ASR 1000 Series will benefit the following types of customers:  Enterprises experiencing explosive network traffic as mobility, cloud networking, and video and collaboration usage ramp up. Cisco ASRs consolidate these various traffic streams and apply traffic management and redundancy properties to them to maintain consistent performance among enterprise sites and cloud locations. Network service providers needing to deliver high-performance services, such as DCI and branch-office server aggregation, to business customers. Service providers can also use the multiservice routers to deploy hosted and managed services to business and multimedia services to residential customers. Existing Cisco 7200 Series Router (End-of-Sale) customers looking for simple migration to a new multiservice platform that delivers greater performance with the same design.  Device Type: Router Enclosure Type: Desktop - modular - 1U Dimensions (WxDxH): 17.3 in x 22.5 in x 1.7 in Performance ESP Bandwidth: 2.5 GBps RAM: 4 GB (installed) / 16 GB (max) Power: Installed power supply - redundant - 2 (installed)/ 2 (max) Expansion Slots: 1 (total) / 1 (free) x expansion slot Installed Modules: 0 (installed) / 1 (max) Interfaces: Management : 1 x 10Base-T/100Base-TX - RJ-45 ¦ Management : 1 x console - RJ-45 ¦ Management : 1 x auxiliary - RJ-45 ¦ LAN : 4 x SFP (mini-GBIC) ¦ USB : 1 x 4 pin USB Type A   \n"
