  "745": {
    "image": "https://www.networkoutlet.com/cdn/shop/products/a9k-36x10ge-se__69070_300x300.jpg?v=1625770511",
    "title": "A9K-36X10GE-TR Cisco ASR 9000 36-Port 10GE Line Card, Packet Transport  Optimized",
    "brand": "Cisco",
    "category": "Routers",
    "price": "$2,400.00",
    "description": "\nA9K-36X10GE-TR Cisco ASR 9000 36-Port 10GE Line Card, Packet Transport Optimized Part Number: A9K-36X10GE-TR The Cisco® ASR 9000 Series 36-Port 10 Gigabit Ethernet Line Cards deliver an industry-leading thirty-six 10-Gigabit Ethernet ports to any slot of a Cisco ASR 9000 Series Aggregation Services Router. These high-capacity line cards are designed to remove bandwidth bottlenecks in the network today that are caused by a large increase in video-on-demand (VoD), IPTV, point-to-point video, Internet video, and cloud services traffic. These line cards deliver economical, scalable, highly available, line-rate Ethernet and IP/Multiprotocol Label Switching (IP/MPLS) edge services. The Cisco ASR 9000 Series line cards and routers are designed to provide the fundamental infrastructure for scalable Carrier Ethernet and IP/MPLS networks, allowing profitable business, residential, and mobile services The Cisco ASR 9000 Series 36-Port 10 Gigabit Ethernet Line Cards are fully compatible with all Cisco ASR 9000 Series chassis, route switch processors (RSPs), and line cards. No hardware upgrade to the chassis or cooling system is required. Total bandwidth is dependent on the number and type of RSPs installed. The Cisco ASR 9000 Series 36-Port 10 Gigabit Ethernet Line Cards are also fully compatible with the 22-slot Cisco ASR 9922 chassis. Each line card provides simultaneous support for both Layer 2 and Layer 3 services and features, helping operators qualify and stock a single line card that can be deployed in any combination of Layer 2 and Layer 3 applications, thereby reducing capital expenditures (CapEx) and operating expenses (OpEx), as well as reducing the time required to develop and deploy new services. The Cisco ASR 9000 Series Ethernet line cards set a new standard for Layer 2 and Layer 3 service density and scale, allowing operators to offer predictable, managed transport services while optimizing the use of network assets. The line cards, with their synchronization circuitry and dedicated backplane timing traces for accessing the RSP’s Stratum-3 subsystem, provide standards-based line-interface functions for delivering and deriving transport-class network timing, allowing support of network-synchronized services and applications such as mobile backhaul and time-division multiplexing (TDM) migration. Coupled with the proper RSP, the line cards can also be used for applications requiring IEEE 1588v2 synchronization services. Recognizing that real-time media dominate next-generation services, Cisco has integrated media-monitoring technology into the Cisco ASR 9000 Series Ethernet line cards. This multimedia technology allows real-time monitoring and statistics collection of real-time video and voice flows, facilitating proactive maintenance and management of today’s comprehensive media services. Addressing the advantages of consolidating IP with the transport network, G.709 with Advanced Forward Error Correction (FEC) is provided. G.709 provides visibility into the transmission system to permit rapid detection and recovery from transmission-layer impairments. G.709 can also be configured for proactive protection if signal degradation is detected; it prevents traffic loss and link outages. Advanced FEC extends transmission-layer performance, delivering extended performance over an amplified system without the cost of regeneration or transponders. Options: Each line card is available as either a Service Edge Optimized (enhanced QoS) or Packet Transport Optimized (basic QoS) line card \n"
  },
