    "price": "$650.00",
    "description": "\nThe Cisco Nexus® 7700 F3-Series 48-Port Fiber 1 and 10 Gigabit Ethernet Module (referred to as the 7700 F3-Series module in this document) offers wire-rate performance on each port. As a result, enterprises can use it to deploy a high-density, low-latency, scalable architecture for powering a mission-critical data center. he 7700 F3-Series module is based on the Cisco Nexus F3-Series Switch-on-a-Chip (SoC) ASIC. This type of design increases performance while lowering the power and cooling requirements of the module. The F3-Series SoC is an innovative ASIC designed by Cisco and powered by a flexible packet engine that makes it particularly suitable for building the network infrastructure of public and private cloud environments. The F3-Series engine supports all the foundational networking protocols needed to build Layer 2 and Layer 3 networks, but it also can support highly virtualized environments. It can thus enable virtual overlay networking with hardware support for Cisco Virtual Extensible LAN (VXLAN) and Locator/ID Separation Protocol (LISP) technologies. The 7700 F3-Series hardware enables customers to transparently interconnect their data centers with protocols such as Overlay Transport Virtualization (OTV) and Multiprotocol Label Switching (MPLS) and Virtual Private LAN Service (VPLS). The module delivers 720 million packets per second (mpps) of distributed Layer 2 and Layer 3 forwarding and up to 480 Gbps of data throughput. A 7700 18-Slot Switch fully populated with the 7700 F3-Series module can deliver up to 11.5 billion packets per second (bpps) and 15.4 terabits per second (Tbps) of switching performance. The 7700 F3-Series module integrates a broad set of data center switching technologies, including industry standards and Cisco's own innovations. It combines the benefits of classic fabric interface line cards with the advanced routing features of edge interface modules. With this integration, the module provides exceptional investment protection for organizations consolidating their data center environments while migrating to dense, multiservice 10 Gigabit Ethernet networks.  The 7700 F3-Series module is powered by the proven and comprehensive NX-OS feature set. This extremely comprehensive set of Layer 2 and Layer 3 functions makes this module excellent for data center networks, in which density, performance, and continuous system operation are critical. The 7700 F3-Series module is a critical enabler of Cisco FabricPath. With FabricPath, organizations can build resilient, flexible, and if needed, massively scalable Layer 2 networks. FabricPath protects enterprises' investments by allowing existing spanning-tree-based deployments to be connected to a FabricPath network. The 7700 F3-Series module can be used in conjunction with the Cisco Nexus 2000 Series Fabric Extenders (FEX). The 2000 Series is designed to simplify data center architecture and operations by dramatically reducing the number of points of management. The 7700 F3-Series module delivers integrated Fibre Channel over Ethernet (FCoE), greatly simplifying the network infrastructure and reducing costs by enabling the deployment of unified data center fabrics to consolidate data center traffic onto a single, general-purpose, high-performance, highly available network. With the 7700 F3-Series module, FCoE can be deployed in director-class modular platforms for the access layer and core of converged networks. The 7700 F3-Series module provides support for wire-rate VXLAN, offering the architectural flexibility needed to expand cloud deployments with repeatable pods in different Layer 2 domains. VXLAN can also enable migration of virtual machines between servers across Layer 3 networks. The support of advanced Data Center Interconnect (DCI) protocols such as Cisco OTV and VPLS makes the module excellent for helping customers simplify the extension of applications across geographically dispersed data center sites. The 7700 F3-Series module supports high-performance MPLS for 10 Gigabit Ethernet data center deployments. Support for Cisco LISP enables enterprises and service providers to simplify multihomed routing and facilitates scalable any-to-any WAN connectivity while supporting data center virtual machine mobility. The Virtual Device Context (VDC) feature helps enable the virtualization of a single physical device in one or more logical devices. Each provisioned logical device is configured and managed as if it were a separate physical device. The 7700 F3-Series module offers exceptional security with integrated hardware support for:  Configurable Control-Plane Policing (CoPP), which protects the supervisor CPU from excessive traffic Access Control List (ACL) counters and logging capability to provide deeper packet visibility Layer 2 to Layer 4 ACL for both IPv4 and IPv6 traffic Cisco TrustSec® technology, including line-rate data confidentiality, data integrity, and ACL processing for Security Group Tags (SGTs); data confidentiality and integrity conforming to the IEEE MAC security standard (IEEE 802.1AE MACsec) is supported on a subset of ports: more specifically, ports 41 to 48 (the rightmost eight ports) on the module support the Advanced Encryption Standard (AES) cipher, using a 128-bit key   Note: TrustSec SGT on the F3 Series Modules: F3 Series I/O modules require a dot1q header to be present for proper processing and transport of SGT-tagged packets. For Layer 2 switch ports use trunked interfaces instead of an access VLAN. Layer 3 interfaces should be configured as an L3 subinterface to force the dot1q over the L3 interconnection.   \n"
