    "description": "\nGet high-density, workload isolation, and wire-rate layer 2 and 3 switching on a data-center-class, Cisco NX-OS operating system. The Cisco Nexus 3132Q Switch, part of the Cisco Unified Fabric family, is a compact, 1-rack-unit (1RU), form factor switch for top-of-rack (ToR) data center deployments. Features and CapabilitiesFlexibility and High Performance  Provides layer 2 and 3 switching of up to 2.5 terabits per second (Tbps) and more than 950 million packets per second (mpps) Phyless design on all ports to optimize latency 32 fixed 40 Gigabit Ethernet (GE) Quad small form factor pluggable plus (QSFP+) ports Supports mobility and tenant isolation with VXLAN (with a software upgrade)  Ease of OperationsThe modular, resilient, Cisco NX-OS operating system is purpose-built with exceptional support for layer 3 unicast and multicast routing protocols. Manageability features promote ease of use and include:  PowerOn Auto Provisioning (POAP) for touchless bootup and configuration of the switch, drastically reducing provisioning time Cisco Embedded Event Manager (EEM) and Python scripting Advanced software-defined networking (SDN) capabilities, including support for Open Flow and Cisco OnePK Integration with Cisco Prime Data Center Network Manager (DCNM) and XML management tools  Specifications at a GlancePhysical specifications:  Dual redundant power supplies Redundant (3 plus 1) and hot-swappable fans One 10/100/1000 Mbps management port One RS-232 serial console port 32 QSFP+ - each supports native 40 Gigabit Ethernet and 4 x 10 Gigabit Ethernet modes 4 SFP+ ports that are internally multiplexed with the first QSFP+ port One USB port  Performance specifications:  2.5 Tbps switching capacity Forwarding rate of 950 mpps Configurable maximum transmission units (MTUs) of up to 9216 bytes (jumbo frames)  \n"
