    "description": "\nThe Cisco Nexus 9500 Series modular switches are capable of supporting up to 172.8 Terabits per second (Tbps) bandwidth with a comprehensive selection of line cards and fabric modules that provide 1-, 10-, 25-, 40-, 50-, and 100-Gigabit Ethernet interfaces.\nCisco Nexus 9500 Platform Line Cards\nThe Cisco Nexus 9500 platform supports hot-swappable line cards and fabric modules optimized for data-center deployments. These line cards are built using a combination of Cisco® ASICs and merchant ASICs.\nN9K-X9464PX: 1- and 10-Gigabit Ethernet and 10- and 40-Gigabit Ethernet Line Card● 48-port 1- and 10-Gigabit Ethernet SFP+ with 4-port 40-Gigabit Ethernet QSFP+ line card\n"
