    "description": "\nThe Cisco Nexus N9K-X9432PQ line card provides 32x40GigE QSFP+ ports or up to 128x 10GBE SFP+ ports to your Nexus 9500 series switches.\nOptions for QSFP+ & SFP+ optics are below:\nQSFP+ Optics\nSFP+ Optics\n"
