  "1517": {
    "image": "https://www.networkoutlet.com/cdn/shop/products/WS-X4748-SFP-E_Appearance_300x300.jpg?v=1615564993",
    "title": "WS-X4748-SFP-E Cisco Catalyst 4500E Series 48-Port GE (SFP) Line Card",
    "brand": "Cisco",
    "category": "Switches",
    "price": "$12,900.00",
    "description": "\n \nThe Cisco WS-X4748-SFP-E Catalyst 4500E Series 48-Port GE (SFP) Line Card provides:\n\n\n48-port nonblocking SFP line card, providing 48 gigabits per-slot capacity\n\nIEEE 802.1AE Fiber Encryption and Cisco TrustSec capability in hardware\nL2-4 Jumbo Frame support (up to 9216 bytes)\nInherits Supervisor Engine QoS capability\nSupported on all 3, 6, 7 (R-E & R+E) and 10 (R-E & R+E) slot chassis\nEnterprise, mid-market, and commercial core and distribution deployments requiring line-rate capability\nService provider: GE aggregation for DSLAM/PON/mobile data backhaul; Point-to-Point fiber to the home (FTTH) or building (FTTB) for residential and business applications\nEnterprise: Providing Fiber to the Desktop (FTTD), for deployments where non-blocking is mandatory requirement\n\nCisco Catalyst 4500 Series Switches offer an extensive line of modules that support numerous speeds and physical media combinations. These line cards are functionally transparent; all the packet processing, queuing, buffering, and QoS occur in the supervisor engine. To that end, both classic and E-Series line cards acquire the features and capabilities of the installed supervisor engine. For example, a classic line card previously deployed with a classic supervisor engine using four queues per port will automatically have capability for eight queues per port if redeployed with a Supervisor Engine 8-E/7-E/6-E. This architecture enables customers to easily upgrade all Ethernet line cards on their Cisco Catalyst 4500 Series systems to higher layer switching functions by adding a new supervisor engine. The simple design of the line cards results in a very high mean time between failures (MTBF), helping ensure high availability for a single connection to an end user.\n"
  },
