    "brand": "Cisco",
    "category": "Switches",
    "price": "$5,200.00",
    "description": "\nThe Cisco Nexus® 7700 M3-Series 48-Port 1 and 10 Gigabit Ethernet Module is a versatile I/O module with a comprehensive feature set that offers wire-rate performance on each port. The module provides deep buffers and high-capacity ternary content-addressable memory (TCAM), making this module an excellent choice for building high-density, low-latency, scalable data centers.\nThe Cisco Nexus 7000 Series Switches are the foundation of the Cisco® Unified Fabric solution. Designed to meet the requirements of mission-critical data centers, these switches deliver exceptional availability, outstanding scalability, and the proven and comprehensive Cisco NX-OS Software data center switching feature set.\nThe Cisco Nexus 7700 platform, which supports more than 83 terabits per second (Tbps), is the latest extension to the Cisco Nexus 7000 Series modular switches. The Cisco Nexus 7700 platform switches are operationally consistent with the existing Cisco Nexus 7000 Series switches and have a similar system architecture. The Cisco Nexus 7700 Series switches are designed using the same application-specific integrated circuit (ASIC) technology and run on the same proven NX-OS releases as the Cisco Nexus 7000 switches. Table 1 summarizes the 1 and 10 GE port density of switches in this platform.\n\n"
