    "category": "Switches",
    "price": "$6,700.00",
    "description": "\nThe Cisco Nexus 9336C-FX2 Switch is a 1RU switch that supports 7.2 Tbps of bandwidth and over 2.4 bpps. The switch can be configured to work as 1/10/25/40/50/100-Gbps offering flexible options in a compact form factor. Breakout is supported on all ports.\nThe Cisco Nexus 9300-FX2 Series switches belongs to the fixed Cisco Nexus 9000 platform based on Cisco Cloud Scale technology. The platform support cost-effective cloud-scale deployments, an increased number of endpoints, and cloud services with wire-rate security and telemetry. The platform is built on modern system architecture designed to provide high performance and meet the evolving needs of highly scalable data centers and growing enterprises.Cisco Nexus 9300-FX2 series is an extension of Nexus 9300-FX series switches with higher bandwidth capacity. The switches offer a variety of interface options to transparently migrate existing data centers from 1-Gbps, and 10-Gbps speeds to 25- Gbps at the server, and from 10- and 40-Gbps speeds to 50- and 100- Gbps at the aggregation layer. The platforms provide investment protection for customers, delivering large buffers, highly flexible Layer 2 and Layer 3 scalability, and performance to meet the changing needs of virtualized data centers and automated cloud environments.Cisco provides two modes of operation for Cisco Nexus 9000 Series Switches. Organizations can use Cisco NX-OS Software to deploy the switches in standard Cisco Nexus switch environments (NX-OS mode). Organizations can also deploy the infrastructure that is ready to support the Cisco Application Centric Infrastructure (Cisco ACI™) platform to take full advantage of an automated, policy-based, systems-management approach (ACI mode).\n"
