    "brand": "Cisco",
    "category": "Switches",
    "price": "$800.00",
    "description": "\nThe Cisco Catalyst 3850 48 Port UPOE LAN Base is part of the Cisco family which provides the broadest line of solutions for transporting data, voice and video while ensuring that networks both public and private operate with maximum performance, security, and flexibility. These stackable switches allow you to connect devices such as Cisco IP Phones, Cisco Wireless Access Points, workstations, and other network devices such as servers, routers, and other switches. The stacking is supported through Cisco StackWise-480 technology and power management through StackPower.\nDevice Type: Switch - 48 ports - L3 - managed - stackable\nEnclosure Type: Desktop, rack-mountable 1U\nDimensions (WxDxH): 17.5 in x 17.7 in x 1.8 in\nFeatures: Auto-negotiation, ARP support, trunking, VLAN support, auto-uplink (auto MDI/MDI-X), IGMP snooping, Syslog support, IPv6 support, Rapid Spanning Tree Protocol (RSTP) support, Multiple Spanning Tree Protocol (MSTP) support, DHCP snooping, Dynamic Trunking Protocol (DTP) support, Port Aggregation Protocol (PAgP) support, Trivial File Transfer Protocol (TFTP) support, Access Control List (ACL) support, Quality of Service (QoS), RADIUS support, Virtual Route Forwarding-Lite (VRF-Lite), MLD snooping, Dynamic ARP Inspection (DAI), STP Root Guard, Uni-Directional Link Detection (UDLD), Rapid Per-VLAN Spanning Tree Plus (PVRST+), IPv4 support, Shaped Round Robin (SRR), Link Aggregation Control Protocol (LACP), Remote Switch Port Analyzer (RSPAN), layer 3 load balancing, Energy Efficient Ethernet, universal power over Ethernet (UPOE), Cisco StackWise-480 technology, Cisco StackPower technology, Flexible NetFlow (FNF)\nCapacity: IPv4 routes : 24000 ¦ NetFlow entries : 48000 ¦ Switched virtual interfaces (SVIs) : 1000\nRouting Protocol: RIP-1, RIP-2, EIGRP, RIPng\nPerformance: Switching capacity : 176 Gbps ¦ Stacking bandwidth : 480 Gbps\nCompliant Standards: CISPR 22 Class A, GOST, BSMI CNS 13438 Class A, CISPR 24, EN 61000-3-2, NOM, EN 61000-3-3, EN55024, EN55022 Class A, ICES-003 Class A, RoHS, UL 60950-1 Second Edition, KCC, FCC Part 15 A, ISO 7779, CSA C22.2 No. 60950-1 Second Edition, EN 60950-1 Second Edition, IEC 60950-1 Second Edition, VCCI Class A\nInterfaces: 48 x 1000Base-T 10Base-T/100Base-TX/1000Base-T - RJ-45 - RJ-45 - UPOE - 60 W ¦ USB : 1 x USB 4 pin USB Type A - Type A ¦ 1 x management (mini-USB) console - mini-USB Type B - Type B ¦ 1 x serial (RS-232) RS-232 - RJ-45 - RJ-45 - management ¦ 1 x management (Gigabit LAN) 10Base-T/100Base-TX/1000Base-T - RJ-45 - RJ-45 ¦ Network stack device : 2 x network stack device\nExpansion Slots: 1 (total) / 1 (free) x expansion slot\n\n"
